    "description": "Can you infect the world? Plague Inc. is a unique mix of high strategy and terrifyingly realistic simulation.<br><br>Your pathogen has just infected 'Patient Zero'. Now you must bring about the end of human history by evolving a deadly, global Plague whilst adapting against everything humanity can do to defend itself. <br><br>Brilliantly executed with innovative gameplay and built from the ground up for touchscreen, Plague Inc. from developer Ndemic Creations evolves the strategy genre and pushes mobile gaming (and you) to new levels. It’s You vs. the world - only the strongest can survive! <br><br>◈◈◈ #1 top game globally with 200 million+ games played ◈◈◈<br><br>Plague Inc. is a global hit with over half a million 5 star ratings and features in newspapers such as The Economist, New York Post, Boston Herald, The Guardian and London Metro! <br><br>The developer of Plague Inc. was invited to speak at the CDC in Atlanta about the disease models inside the game!<br><br>▶ “The game creates a compelling world that engages the public on serious public health topics” – The Centers for Disease Control and Prevention<br>▶ “Best Tablet Game of 2012” - New York Daily News <br>▶ “Plague Inc. will snag your attention in all the right ways and keep it there” - Touch Arcade <br>▶ “No denying Plague Inc.'s high-level of quality” - Modojo <br>▶ “Plague Inc. should not be as much fun as it is” – London Metro <br>▶ “Will leave you hoping to destroy the world, all in the name of a bit of fun” – Pocket Lint <br>▶ “Plague Inc.'s gameplay is infectious” - Slide to Play <br>▶ Winner – “Overall Game of the Year” – Pocket Gamer<br>▶ “Killing billions has never been so fun” – IGN <br><br>◈◈◈<br><br>Features: <br>● Stunning HD graphics with a highly polished interface (Contagion guaranteed) <br>● Highly detailed, hyper-realistic world with advanced AI (Outbreak management) <br>● Comprehensive in-game help and tutorial system (I am Legendarily helpful) <br>● 12 different disease types with radically different strategies to master (12 Monkeys?) <br>● Full Save/Load functionality (28 Saves Later!) <br>● 50+ countries to infect, hundreds of traits to evolve and thousands of world events to adapt to (Pandemic evolved) <br>● Full game support for scoreboards and achievements <br>● Expansion updates add the mind controlling Neurax Worm, the zombie producing Necroa Virus, Speed Runs and real life Scenarios!<br><br>Localised in English, German, Spanish, Brazilian Portuguese, Italian, French, Japanese, Korean and Russian. (more coming soon) <br><br>P.S. Give yourself a pat on the back if you got all the themed literature references! <br><br>Special sale price to celebrate being the 15th most popular touchscreen game of 2012!<br><br>◈◈◈<br><br>Like Plague Inc. on Facebook: <br>http://www.facebook.com/PlagueInc <br><br>Follow me on Twitter: <br>www.twitter.com/NdemicCreations",
