    "description": "<b>Sudoku for beginners and advanced players</b>. Whether you'd like to relax or keep mind active – pass your free time in a pleasant way! Get a small stimulating break or clear your head with sudoku. Take your favorite app with you wherever you go. Playing Sudoku on mobile is <b>as good as with a real pencil and paper</b>.<br><br>Choose any level you like. Play easier levels to exercise your brain, logical thinking and memory, or try hard levels to give your mind a real workout. Our classic puzzle game has some features that make sudoku easier for you: hints, auto-check, and duplicates highlight. You can use them or complete the challenge without help – it's up to you! What's more, in our app each puzzle has one solution. You will find all you need whether you are playing your first sudoku, or you've progressed to expert difficulty.<br><br><b>Features</b><br>✓ Complete Daily Challenges and get unique trophies<br>✓ Challenge yourself figuring out your mistakes, or enable Auto-Check to see your mistakes as you go<br>✓ Turn on Pencil mode to make notes as on paper. Each time you fill in a cell, notes are automatically updated!<br>✓ Highlight duplicates to avoid repeating numbers in a row, column and block<br>✓ Hints can guide you through the points when you are stuck<br><br><b>More features</b><br>- Statistics. Track your progress for each difficulty level: analyze your best time and other achievements<br>- Unlimited Undos. Made a mistake? Just put it back quickly!<br>- Auto-save. If you leave a sudoku unfinished it will be saved. Continue playing anytime<br>- Highlighting of a row, column and box related to the selected cell<br>- Eraser. Get rid of all mistakes<br><br><b>Highlights</b><br>• More than 5,000 well-formed puzzles<br>• 9x9 grid<br>• 4 perfectly balanced levels of difficulty: easy, medium, hard, and expert<br>• Support both phones and tablets<br>• Portrait and landscape mode for tablets<br>• Simple and intuitive design<br><br>Train your brain anywhere, anytime!",
