    "description": "** Google Play Best of 2015  **<br>Mobile Game of the Year - 2016 DICE Awards<br>Winner 2015 Golden Joystick Best Handheld/Mobile Game<br><br>\"Might just be the best free-to-play game out there\" - GamesBeat<br>\"Probably the best game of E3 2015” – Gizmodo <br>\"Fallout Shelter is simple to play and addictive as hell.\" - GameZone<br><br>BUILD THE PERFECT VAULT<br>Create a brighter future…underground! Select from a variety of modern-day rooms to turn an excavation beneath 2,000 feet of bedrock into the very picture of Vault Life.<br><br>OVERSEE A THRIVING COMMUNITY <br>Get to know your Dwellers and lead them to happiness. Find their ideal jobs and watch them flourish. Provide them with outfits, weapons, and training to improve their abilities.<br><br>CUSTOMIZE<br>Turn worthless junk into useful items with Crafting! Customize the look of any dweller in the Barbershop.<br><br>PROSPER<br>A well-run Vault requires a variety of Dwellers with a mix of skills. Build a Radio Room to attract new Dwellers. Or, take an active role in their personal lives; play matchmaker and watch the sparks fly! <br><br>EXPLORE THE WASTELAND <br>Send Dwellers above ground to explore the blasted surface left behind and seek adventure, handy survival loot, or unspeakable death. Find new armor and weapons, gain experience, and earn Caps. But don’t let them die!<br><br>PROTECT YOUR VAULT<br>From time to time, idyllic Vault life may be disrupted by the dangers of post-nuclear life. Prepare your Dwellers to protect against threats from the outside…and within.<br><br>Vault-Tec has provided the tools, but the rest is up to you. What are you waiting for? Get started building your Vault today for FREE.",
