    "description": "Start playing Candy Crush Saga today –  loved by millions of players around the world.<br><br>With over a trillion levels played, this sweet match 3 puzzle game is one of the most popular mobile games of all time!<br><br>Switch and match Candies in this divine puzzle adventure to progress to the next level in hope of achieving that sweet feeling! Quick thinking and smart moves are rewarded with delicious rainbow-colored cascades and tasty candy combos!<br><br>Plan your moves by matching 3 or more candies in a row, using boosters wisely in order to overcome those extra sticky levels! Smash the chocolate and collect ingredients across thousands of levels guaranteed to have you craving more!<br><br>Take on this deliciously sweet match 3 Saga alone or play with friends! Candy Crush Saga is completely free to play but some optional in-game items will require payment.<br><br>By downloading this game you are agreeing to our terms of service; http://about.king.com/consumer-terms/terms<br><br>Candy Crush Saga features:<br>● Tasty ways to play: Target Score, Clear the Jelly, Collect the Ingredients and Order Mode to name a few!<br>● Check back daily to receive free tasty rewards, take part in time limited challenges to earn boosters to help you level up! <br>● Collect sugar drops to progress along the Sugar Track for super sweet surprises!<br>● Spin the Daily Booster Wheel for a delicious prize <br>● Unwrap delicious environments and meet the sweetest characters<br>● Tasty Candies, wrapped and striped Special Candies, Color Bombs and various other magical boosters to help with those challenging sticky levels<br>● Thousands of the best levels and puzzles in the Candy Kingdom and with more added every 2 weeks your sugar fix is never far away! <br>● Leaderboards to watch your friends and competitors!<br>● It's easy to sync the game between devices and unlock full game features when connected to the Internet<br><br>Visit https://care.king.com/ if you need help!<br><br>Follow us to get news and updates;<br>facebook.com/CandyCrushSaga<br>Twitter @CandyCrushSaga<br>https://www.youtube.com/user/CandyCrushOfficial<br>http://candycrushsaga.com/<br><br>Have fun playing Candy Crush Saga the sweetest match 3 game around!",
