    "description": "“This is the only NBA mobile game where it feels like I’m playing as myself.” – James Harden <br><br>Choose your path to basketball greatness in the all-new season of EA SPORTS NBA LIVE. Build your team, dominate opponents in PVP, boost your Rep, upgrade players, take over the Blacktop, and connect with the NBA in Live Events. Capture the spotlight and create your legacy in the world’s most downloaded basketball game.<br><br>LEAD A TOP SQUAD <br>Create the ultimate basketball roster as you upgrade players, rain buckets, slam dunks, and rise up the ranks in the NBA. With Chemistry, choose and match players that mirror their coach’s playstyle, allowing you to focus on shooting, defensive, a run-and-gun style, and more to get boosts and elevate your hoops game. Get your team in the zone to become basketball’s best squad. <br><br>GAIN YOUR REP<br>Beat opponents in Head-to-Head matches and Leagues to earn Rep. Use it to earn special packs or Rank Up players to their maximum performance level. The higher your players’ levels, the better basketball they’ll play on the court. Strategy rules in this battle for hoops victory. <br><br>OWN THE BLACKTOP<br>No quarters. No shot clock. No rules. Head outdoors to the blacktop and build a lineup of classic basketball players to compete against other NBA legends and prove yourself on the courts where bonafide ballers are made. From Brooklyn to Chicago to Venice Beach, experience a different feel and unique events that keep the stakes high and the wins rolling in. <br><br>COMPETE IN LIVE EVENTS<br>Connect to the NBA all year long with daily PVP challenges that keep you raining buckets and throwing down dunks all the way to the top. Score incredible rewards in real-life hoops matchups and break ankles in Seasons or Head-to-Head mode with friends and foes. Become a hoop master all day, every day.<br><br>This app: requires a persistent Internet connection (network fees may apply); Requires acceptance of EA’s Privacy & Cookie Policy and User Agreement.<br>; includes in-game advertising; collects data through third party analytics technology (see Privacy & Cookie Policy for details); contains direct links to the Internet and social networking sites intended for an audience over 13.<br><br>*Facebook login required. Must be 13 years or older.",
