    "description": "OVER 860 MILLION PLAYERS GLOBALLY!<br><br>Race with the Minions in the award-winning, fan-favorite runner, Minion Rush!<br>Run as fast as you can while jumping, dodging, rolling and knocking Minions off the track in despicably action-packed levels. <br>Rush to collect Bananas and play exciting Special Missions to increase your score as you enjoy unexpected Minion moments.<br><br>ALL THE FUN OF THE DESPICABLE ME MOVIES IN THE OFFICIAL GAME!<br><br>• Race as DAVE, CARL OR JERRY -- and straight out of the Despicable Me 3 movie, MEL!<br>• Wear incredibly UNIQUE COSTUMES, such as Lucy, the Surfer or the Ninja Minion.<br>• Speed through ICONIC LOCATIONS inspired by the Despicable Me movies, like Bratt's Lair, the Anti-Villain League and ancient Egyptian temples in The Pyramids.<br>• Power up your Minions by riding the FLUFFY UNICORN or GRU'S ROCKET.<br>• Play SPECIAL MISSIONS to discover new content and new Costumes in each update!<br>______________________________________________<br><br>You can download and play this game for free. Please be informed that it also allows you to play using virtual currency, which can be acquired as you progress through the game, watching certain advertisements, or by paying with real money. Purchases of virtual currency using real money are performed using a credit card, or other form of payment associated with your account, and are activated when you input your Google Play account password, without the need to re-enter your credit card number or PIN. <br>In-app purchases can be restricted by adjusting the authentication settings within your Play Store settings (Google Play Store Home > Settings > Require authentication for purchases) and setting up a password for each purchase / Every 30 minutes or Never. <br>Disabling password protection may result in unauthorized purchases. We strongly encourage you to keep password protection turned on if you have children or if others could have access to your device.<br>This game contains advertising for Gameloft’s products or some third parties which will redirect you to a third-party site. You can disable your device’s ad identifier being used for interest-based advertising in the settings menu of your device. This option can be found in the Settings app > Accounts (Personal) > Google > Ads (Settings and Privacy) > Opt out of interest-based ads.<br>Certain aspects of this game will require the player to connect to the Internet. <br>______________________________________________<br><br>Find out more about the game on the official site -- http://www.minionrush.com<br>Follow us on Facebook at http://gmlft.co/MinionRush_FB and on Instagram http://gmlft.co/MinionRush_IN<br>Check out our videos and game trailers on http://gmlft.co/MinionRush_YT<br>____________________________________________<br><br>Visit our official site at http://gmlft.co/website_EN<br>Check out the new blog at http://gmlft.co/central<br><br>Don't forget to follow us on social media:<br><br>Facebook: http://gmlft.co/DM2Facebook<br>Twitter: http://gmlft.co/SNS_TW_EN<br>Instagram: http://gmlft.co/GL_SNS_IG<br>YouTube: http://gmlft.co/DM2YouTube<br>Forum: http://gmlft.co/DM2_Forum<br><br>Privacy Policy: http://www.gameloft.com/en/privacy-notice<br>Terms of Use: http://www.gameloft.com/en/conditions-of-use<br>End-User License Agreement: http://www.gameloft.com/en/eula",
